<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(79.5, 35.0);
			ctx.lineTo(79.5, 65.0);
			ctx.stroke();

			// #path4
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(34.5, 49.5);
			ctx.bezierCurveTo(34.5, 69.5, 64.5, 69.5, 64.5, 49.5);
			ctx.bezierCurveTo(64.5, 29.5, 34.5, 29.5, 34.5, 49.5);
			ctx.closePath();
			ctx.stroke();

			// #path5
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(95.0, 50.0);
			ctx.lineTo(65.0, 50.0);
			ctx.stroke();

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(35.0, 49.5);
			ctx.lineTo(5.0, 49.5);
			ctx.stroke();
		</script>
	</body>
</html>
